import './App.css';
import ExpensiveComputationExample from './ExpensiveComputationExample';
import { useState, useId } from 'react';
function App() {
  const id = useId();
  const id1 = useId();

  return (
    <div className="App">

      <ExpensiveComputationExample htmlFor={`${id}`} />
      <ExpensiveComputationExample htmlFor={`${id1}`} />

    </div>
  );
}

export default App;
